description:
December 1944
The Battle of the Bulge has been raging for several days.  In a forest covered with snow and frost, faraway explosions still reach the ears of an Airborne GI lying shot in the snow. Facing him, two helpless children try to prevent him from dying. But, a blood stain is crawling inexorably across the snow...
